import React from "react"
import Square from "./Square";
import './board.css'
function Board () {
  return (
    <div className="board">
      <Square id={0}/>
      <Square id={1}/>
      <Square id={2}/>
      <Square id={3}/>
      <Square id={4}/>
      <Square id={5}/>
      <Square id={6}/>
      <Square id={7}/>
      <Square id={8}/>
    </div>
  )
};

export default Board;
